    data: |
      SELECT DISTINCT - - col1 * + - ( - + col0 ) + - col0 - - + col1 * - - 60 AS col0 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q5324.out
    data: |
      3000
      60
      6060
